func deobfuscate(in []int) ([]byte, error) {
	var out []byte
	secret, constant := in[:len(in)-1], in[len(in)-1]
	for i, val := range secret {
		decoded := val - i - constant
		if decoded < 0 || 255 < decoded {
			return out, errors.New("Integer out of byte range")
		}
		out = append(out, byte(decoded))
	}
	return out, nil
}

